import React from 'react';
import {NavLink} from "react-router-dom";

const Navbar = () => {
    return (
        <header>
            <input type="text"/>
            <nav>
                <ul>
                    <NavLink to={'/'} end className={(nav) => (nav.isActive ? "nav-active" : "")}>
                        <li>Accueil</li>
                    </NavLink>
                    <NavLink to={'/films'} className={(nav) => (nav.isActive ? "nav-active" : "")}>
                        <li>Films</li>
                    </NavLink>
                    <NavLink to={'/series'} className={(nav) => (nav.isActive ? "nav-active" : "")}>
                        <li>SÃ©ries</li>
                    </NavLink>
                    <NavLink to={'/mes-coups-de-coeur'} className={(nav) => (nav.isActive ? "nav-active" : "")}>
                        <li>Ma liste</li>
                    </NavLink>
                </ul>
            </nav>
            <div className="profile-container">
                <div className="list"><i className="fa-regular fa-heart"></i></div>
                <div className="profile"><img src={'./images/logo-webflix.png'} alt=""/></div>
            </div>
        </header>
    );
};

export default Navbar;
